  const expenseDataHandler = (expenseData) => {
    const saveExpenseData = {
      ...expenseData,
      id: Math.random().toString(),
    };
    props.onSaveData(saveExpenseData);
  };
  return (
    <div className="expense container mt-4">
      <ExpenseForm onExpenseData={onAddExpense} />
    </div>
  );
};

